@jackfinn1224
4 minutes ago
I have to say first that I have enjoyed immensely everything that Park Eun-bin has been in on the Netflix platform. The advertising breaks are shorter and placed somewhat more "strategically" throughout the program content thereby not sacrificing the continuity. Here in the U.S. at least, Hyper Knife was presented on the "hulu" platform (a Disney+ affiliate).  The advertising breaks were extremely disruptive and thoroughly annoying. I watched all the episodes because I am "hooked" on Park Euin -bin but I absolutely HATE  hulu.  I don't  know what sort of Faustian bargain has been made with Disney but perhaps  some kind of arrangement can be made to get any further content moved back to Netflix.   hulu sucks!

근데 좀 많이 아쉽던데;;;
사이코 패스들의 살벌한 심리전 스릴러도 아니고  그렇다고 뭐 악인들이 뭐 댓가를 치루는 것도 아니고
엔딩도 그렇고 이도저도 아닌 결말로 어영부영 끝난거 같은데 요즘 드라마 시나리오가 많이 허술해진거 같아서 아쉽긴 하네요
